import React, {Component} from 'react';

class Burger extends Component{
    render() {

        constructor(props);{
            this.state = {
                slideLink: "slidingLink",
            };
        }

        return(
            <div className={this.state.slidingLink}>
                <ul>
                    <div className="webPages">
                        <h4>Web Pages</h4>
                        <li>Accueil</li>
                        <li>Equipe</li>
                    </div>
                    <div className="appPages">
                        <h4>App Pages</h4>
                        <li>Inscription</li>
                        <li>Connexion</li>
                    </div>
                </ul>
            </div>
        )
    }
}

export default Burger;
